th=\"150\" height=\"100\" /></p>\n<p><a href=\"http://evansolomon.me/notes/cogitate-simple-readable-wordpress-theme/\"><strong>Cogitate</strong></a> is a more minimalist and readable <a href=\"http://wordpress.org/extend/themes/twentytwelve\">Twenty Twelve</a> child theme.</p>\n<p><img class=\"alignnone size-full wp-image-12243\" title=\"leaf\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2012/11/leaf.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><a href=\"http://wordpress.org/extend/themes/leaf\"><strong>Leaf</strong></a> is a stylish and customizable theme.</p>\n<p><img class=\"alignnone size-full wp-image-12245\" title=\"mosaic\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2012/11/mosaic.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><a href=\"http://wordpress.org/extend/themes/mosaic\"><strong>Mosaic</strong></a> is a clean, lightweight and fully responsive theme.</p>\n<p><img class=\"alignnone size-full wp-image-12244\" title=\"twentypluslite\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2012/11/twentypluslite.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><a href=\"http://zeaks.org/general/twenty-plus-lite-twenty-twelve-child-theme/\"><strong>Twenty Plus Lite</strong></a> is a child theme for <a href=\"http://wordpress.org/extend/themes/twentytwelve\">Twenty Twelve</a> with several features, layouts and schemes.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/e6wc7rF_VCo\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 17 Nov 2012 15:00:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Matt: Bitcoin on WordPress.com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=41995\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"http://ma.tt/2012/11/bitcoin-on-wordpress-com/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:903:\"<p><a href=\"http://en.blog.wordpress.com/2012/11/15/pay-another-way-bitcoin/\">WordPress.com now accepts payments via Bitcoin</a>, possibly the largest internet service yet to adopt it. I find Bitcoin intrinsically interesting <a href=\"http://www.newyorker.com/reporting/2011/10/10/111010fa_fact_davis\">as a crypto-currency</a>, but it also might open up our premium services to folks who couldn&#8217;t use them before. It&#8217;s been fun to watch the store engine of WP.com evolve behind the scenes. In other WordPress.com news, there are now verticals for <a href=\"http://en.blog.wordpress.com/2012/11/14/wordpress-for-cities/\">municipalities</a> and <a href=\"http://en.blog.wordpress.com/2012/10/30/make-your-bands-site-sing/\">bands</a>, and we compiled <a href=\"http://en.blog.wordpress.com/2012/11/05/the-wordpress-bestseller-list/\">an incomplete list of best-selling authors on WordPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 16 Nov 2012 07:45:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"Weblog Tools Collection: WordPress Plugin Releases for 11/15\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12235\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/fJJyQSGXRGU/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1315:\"<h3>New plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/auto-upload-images/\"><strong>Auto Upload Images</strong></a> automatically uploads external images within posts to your WordPress site&#8217;s Media library.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/safe-report-comments/\"><strong>Safe Report Comments</strong></a> gives your visitors the ability to report a comment as inappropriate.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/co-authors-plus/\"><strong>Co-Authors Plus</strong></a> allows you to assign multiple bylines to posts, pages, and custom post types via a search-as-you-type input box.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/facebook/\"><strong>Facebook</strong></a> makes your site deeply social by integrating functionality from Facebook.</p>\n<p><a href=\"http://slingpic.com/get/index.html\"><strong>Slingpic</strong></a> is an image sharing tool that allows your users to share images from your site quickly and easily.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/wp-email-login/\"><strong>WP Email Login</strong></a> allows you to use your email address instead of a username to log into your WordPress site.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/fJJyQSGXRGU\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 15 Nov 2012 14:45:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Alex King: Take RAMP for a Spin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://alexking.org/?p=14450\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"http://alexking.org/blog/2012/11/14/ramp-online-demo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2127:\"<p>We recently added the ability to take RAMP for a test drive before you buy. On the RAMP page, click that &#8220;Demo&#8221; button to sign up and we&#8217;ll set up both a staging and production WordPress site for you &#8211; with RAMP installed and configured on both sites. You can log in, create and upload content, etc. Use the Quick Send feature to send a single change over immediately or make a bunch of change, add them to a batch, and send them all at once.</p>\n<p><a href=\"http://crowdfavorite.com/wordpress/ramp/\"><img src=\"http://alexking.org/wp-content/uploads/2012/11/Screen-Shot-2012-11-13-at-3.11.30-PM-510x345.png\" alt=\"\" title=\"RAMP demo\" width=\"480\" height=\"324\" class=\"alignnone size-medium-img wp-image-15141\" /></a></p>\n<p><a href=\"http://crowdfavorite.com/wordpress/ramp/\">RAMP</a> is a commercial GPL WordPress plugin for migrating content between your staging server and your production server. Maybe you need to create a few new pages, update a few others, stage it for internal review and critique and then push it all live at once. Maybe you need to tweak a few existing pages and want to make sure they look right before you make the changes on your live site. This is the job RAMP does. It&#8217;s a pretty hard job and RAMP does it in an elegant manner.</p>\n<p>To answer a question I get with some regularity, I see RAMP as primarily a business tool for website maintenance and updates rather than a developer tool for moving a side from a local development environment to a production server.<sup id=\"fnref:1\"><a href=\"http://alexking.org/blog/topic/wordpress/feed#fn:1\" rel=\"footnote\">1</a></sup> I <a href=\"http://shoptalkshow.com/episodes/033-with-alex-king/\">talk about this in some depth</a> on the ShopTalk podcast.</p>\n<p><a href=\"http://crowdfavorite.com/wordpress/ramp/\">Give it a try</a> and see how it works!</p>\n<div class=\"footnotes\">\n<hr />\n<ol>\n<li id=\"fn:1\">\nThere isn&#8217;t a technical limit here, it&#8217;s just the workflow I believe makes the most sense.&#160;<a href=\"http://alexking.org/blog/topic/wordpress/feed#fnref:1\" rev=\"footnote\">&#8617;</a>\n</li>\n</ol>\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 14 Nov 2012 22:31:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"Weblog Tools Collection: WordPress 3.5 Beta 3 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12228\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/cJ4VgmXEFQQ/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1290:\"<p><a href=\"http://wordpress.org/\">WordPress</a> 3.5 Beta 3 <a href=\"http://wordpress.org/news/2012/11/wordpress-3-5-beta-3/\">has been released</a>. Since <a href=\"http://weblogtoolscollection.com/archives/2012/10/13/wordpress-3-5-beta-2-released/\">the second beta</a>, this beta has added <a href=\"http://core.trac.wordpress.org/log/trunk?action=stop_on_copy&mode=stop_on_copy&rev=22557&stop_rev=22224&limit=400\">more than 300 changes</a>, including a new Add Media dialog.</p>\n<p>The developers are forecasting the final WordPress 3.5 release to be in a few short weeks. This particular beta is still is not meant for live sites, but please do try it on a test installation, especially if you are a plugin or theme developer. If you run into any bugs, please check the <a href=\"http://core.trac.wordpress.org/report/5\">known</a> and <a href=\"http://core.trac.wordpress.org/query?status=closed&group=component&milestone=3.5\">fixed</a> issues first, <a href=\"http://codex.wordpress.org/Reporting_Bugs\">report them</a> if they have not already been reported or fixed, and visit <a href=\"http://wordpress.org/support/forum/alphabeta\">the support forums</a> if you need any help.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/cJ4VgmXEFQQ\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 14 Nov 2012 15:15:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Matt: WP Maze\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=41989\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"http://ma.tt/2012/11/wp-maze/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:132:\"<p>Erick Jeckert has made a <a href=\"http://ericjeckert.com/mazes/matt-mullenweg/\">maze with my face and the WordPress logo</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 14 Nov 2012 14:54:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"WordPress.tv: Build Conference: Developers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=14284\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"http://wordpress.tv/2012/11/14/build/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:613:\"<div id=\"v-vnvvUnml-1\" class=\"video-player\">\n</div>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/14284/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/14284/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=14284&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2012/11/14/build/\"><img alt=\"Build Conference: Developers\" src=\"http://videos.videopress.com/vnvvUnml/build2012dev_high_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 14 Nov 2012 09:47:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Michael Pick\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"Alex King: Pressnomics 2012\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://alexking.org/?p=15112\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"http://alexking.org/blog/2012/11/13/pressnomics-2012\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2734:\"<p>The inaugural <a href=\"http://pressnomics.com\">Pressnomics</a> conference was a definitive success. It was a conference dedicated to the WordCamp hallway conversations I enjoy having with 5-10 people at each (non-San Francisco) WordCamp. A &#8220;birds of a feather&#8221; conference for those of us who make our living in the WordPress economy.</p>\n<p>I was honored to be asked to speak, and I gave a presentation titled &#8220;Great Expectations&#8221;. I believe using expectations as a tool for working collaboratively with clients, customers and colleagues is great way to find success. I&#8217;ve been taking notes on the topic for over a year, and enjoyed the opportunity to present them.</p>\n<p>This was a very different presentation than I normally give. I&#8217;m typically walking through code and other technical issues, systematically showing how to do things better in WordPress development. This was a much less concrete topic.</p>\n<p>The free-form presentation style I used resulted in each section running longer than it had in my rehearsal. I wasn&#8217;t prepared to cut sections on the fly, and regret some of the choices I made there (I wish I&#8217;d talked about expectations with free and commercial WordPress plugins). Next time I&#8217;ll be better prepared and will have planned in advance what can be cut if time runs short.</p>\n<p>I re-worked the presentation three different times, ultimately choosing to tell a series of stories with each illustrating a core element or lesson to consider. I got a good deal of validation about the concepts from other folks at the event.</p>\n<p>The slides aren&#8217;t that helpful without the commentary, but I&#8217;m including them here for the sake of completeness. What may be more interesting would be to post write-ups of the content here as a series (and maybe compile it into an ebook). I may well do this.</p>\n<p> </p>\n<p><a href=\"http://www.slideshare.net/alexkingorg/great-expectations-15140151\" title=\"Great expectations\" target=\"_blank\">View on SlideShare</a></p>\n<p>Check out <a href=\"http://www.aztechbeat.com/2012/11/pressnomics-2012-day-1/\">Zachary Burruel&#8217;s recap of day 1</a>, including some notes from my presentation.</p>\n<hr />\n<p>I think many of us at the event were pretty well cooked by the end. There was a ton of great content, which sparked a lot of great debate and <a href=\"http://pressnomics.com/2012/11/cory-miller-asks-the-question-we-all-should-help-answer/\">ideas for follow-through</a>.</p>\n<p>Kudos to <a href=\"http://twitter.com/strebel\">Joshua</a> and <a href=\"http://twitter.com/bizgirl\">Sally</a> of <a href=\"http://page.ly\">Page.ly</a> for putting on a terrific event. I look forward to attending again next year.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Nov 2012 22:01:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Weblog Tools Collection: WordPress Theme Releases for 11/13\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12223\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/cPmA6AsfaHw/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1181:\"<p><img class=\"alignnone size-full wp-image-12224\" title=\"asteroid\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2012/11/asteroid.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><a href=\"http://wordpress.org/extend/themes/asteroid\"><strong>Asteroid</strong></a> is a simple, clean, an