:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"Matt: US Technology Agenda\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=41985\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"http://ma.tt/2012/11/us-technology-agenda/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2509:\"<p>Wired writes on <a href=\"http://www.wired.com/business/2012/11/what-tech-wants-from-four-more-years/all/\">The 8 Missions That Should Dominate Obama&#8217;s Technology Agenda</a>. I&#8217;m quoted there, but here are my full responses to the questions they asked:</p>\n<div class=\"blockquote\">\n<blockquote>\n<strong>1. First off, how did you monitor the election results – phone, TV, twitter laptop, twitter, bar stool?</strong></p>\n<p>I was at a friend’s house with about a dozen people watching mostly CNN, and reading Tweetbot on an iPad Mini.</p>\n<p><strong>2. As someone leading a tech company (or as an investor), what are you looking for the president to do over the next four years? Are there priorities you have that the White House could help you achieve? Either from a business perspective, or a technological/hiring/infrastructure point of view?</strong></p>\n<p>At a macro level I hope the President keeps the economy on a path to recovery, and stays on the right side of anti-internet efforts like SOPA. What we’re building with the web is too early to be marginalized by special interests so early in its growth.</p>\n<p>On a personal level, I hope he keeps fighting for protections and privileges under the law for my non-straight colleagues.</p>\n<p>But the most important things we need to do will likely not have a big effect before 2016. As a country America needs to invest in its infrastructure, particularly broadband, education, particularly STEM, and in streamlining immigration, so the best and brightest who come to our shores aren’t shown the door when they graduate from one of the leading universities in the world. Four years is too short of a timeframe for these investments to pay off but that’s okay because I’m in business for the long run and I want to see our country strengthen and prosper over generations, not just the next economic cycle.</p>\n<p><strong>3. Were there any other races, measures etc. that you were particularly interested in, and why? What was the outcome, and why did you care so much?</strong></p>\n<p>I followed a few of the senate and house races, mostly as they related to SOPA and PIPA, and the state marriage equality measures.</p>\n<p><strong>4. Or, does all this politics stuff have zero bearing on what you are doing?</strong></p>\n<p>Even though the political process often frustrates me, I’ve seen its ability to influence the lives of my friends, family, and colleagues too many times to ignore it any more.\n</p></blockquote>\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 10 Nov 2012 16:10:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s: