ress.com/1.0/gocomments/wptv.wordpress.com/14054/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/14054/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=14054&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2012/11/08/shannon-smith-kathryn-presner-a-beginners-guide-to-wordpress/\"><img alt=\"wcto-beginners-guide-to-wordpress-10-29-2012.mp4\" src=\"http://videos.videopress.com/GpGPmP3h/video-9da1e15bf7_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Nov 2012 01:05:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"Joseph: Jetpack 2.0, Blasting Forward\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://josephscott.org/?p=6480\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"http://josephscott.org/archives/2012/11/jetpack-2-0-blasting-forward/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2409:\"<p>If you haven&#8217;t been following the development of the <a href=\"http://jetpack.me/\">Jetpack</a> WordPress plugin now is a good time to take a look.  Today brings the announcement of <a href=\"http://jetpack.me/2012/11/08/jetpack-2-0-publicize-to-facebook-twitter-linkedin-tumblr-post-by-email-photon-infinite-scroll/\">Jetpack 2.0</a>, adding post by email, photon, and more.</p>\n<p><strong>Post By Email</strong> is something that WordPress has had for some time, but most self hosted WordPress sites don&#8217;t bother with it.  Why?  Because it is a pain to setup and manage.  Jetpack 2.0 brings the features and simplicity of <a href=\"http://jetpack.me/support/post-by-email/\">post by email</a> powered by WordPress.com to self hosted WordPress sites.</p>\n<p>Jetpack has gradually been building up awesome abilities, it isn&#8217;t all about this 2.0 release.  One of the things I&#8217;m most impressed with came in the <a href=\"http://jetpack.me/2012/10/26/jetpack-1-9-toolbar-notifications/\">1.9 release</a>: support for the <a href=\"http://developer.wordpress.com/docs/api/\">WordPress.com REST API</a>.  What this means is that you can now use the WordPress.com REST API to communicate with all WordPress.com hosted sites <strong>AND</strong> Jetpack connected sites.  Let that sink in for a minute.</p>\n<p>What does that look like?  You can try it out with this URL: <a href=\"https://public-api.wordpress.com/rest/v1/sites/josephscott.org\">https://public-api.wordpress.com/rest/v1/sites/josephscott.org</a></p>\n<p>You&#8217;ll get back something like:</p>\n<pre>{\n  \"ID\": 5190300,\n  \"name\": \"Joseph Scott\",\n  \"description\": \"\",\n  \"URL\": \"http:\\/\\/josephscott.org\",\n  \"meta\": {\n    \"links\": {\n      \"self\": \"https:\\/\\/public-api.wordpress.com\\/rest\\/v1\\/sites\\/5190300\",\n      \"help\": \"https:\\/\\/public-api.wordpress.com\\/rest\\/v1\\/sites\\/5190300\\/help\",\n      \"posts\": \"https:\\/\\/public-api.wordpress.com\\/rest\\/v1\\/sites\\/5190300\\/posts\\/\",\n      \"comments\": \"https:\\/\\/public-api.wordpress.com\\/rest\\/v1\\/sites\\/5190300\\/comments\\/\"\n    }\n  }\n}</pre>\n<p>Remember that josephscott.org is not hosted on WordPress.com.</p>\n<p>Developers now have the potential of being able to use a single API end point for every WordPress site out there, it doesn&#8217;t matter if they are hosted on WordPress.com or some place else (assuming they connect with Jetpack).  Now that is impressive.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Nov 2012 20:29:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Joseph Scott\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"Weblog Tools Collection: Jetpack 2.0 has Landed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12211\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/6zUwsa5nkEk/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1352:\"<p><a href=\"http://jetpack.me\">Jetpack</a> 2.0 <a href=\"http://jetpack.me/2012/11/08/jetpack-2-0-publicize-to-facebook-twitter-linkedin-tumblr-post-by-email-photon-infinite-scroll/\">has landed</a>, bringing a new stack of <a href=\"http://wordpress.com\">WordPress.com</a> features to self-hosted <a href=\"http://wordpress.org\">WordPress.org</a> blogs.</p>\n<p>Jetpack 2.0 brings with it a small collection of bug fixes, as well as <a href=\"http://jetpack.me/support/publicize/\">Publicize</a> to automatically share your site’s posts on Facebook, Twitter, Tumblr, Linkedin, and Yahoo!, <a href=\"http://jetpack.me/support/post-by-email/\">Post by Email</a> to publish posts on your blog by email, <a href=\"http://jetpack.me/support/photon/\">Photon</a> to dynamically serve your images from the global WordPress.com cloud (creating less server load and faster images), and <a href=\"http://jetpack.me/support/infinite-scroll/\">Infinite Scroll</a> to load new posts as users scroll down without a full-page refresh in supported themes.</p>\n<p>If you&#8217;re already a Jetpack user, these are definitely some powerful additions to an already great free plugin. If you aren&#8217;t already a Jetpack user, perhaps it&#8217;s time to give it a try.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/6zUwsa5nkEk\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Nov 2012 19:45:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5