:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"Matt: Voters boot SOPA-sponsoring allies\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=41982\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"http://ma.tt/2012/11/voters-boot-sopa-sponsoring-allies/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:285:\"<p><a href=\"http://arstechnica.com/tech-policy/2012/11/voters-boot-three-sopa-sponsoring-hollywood-allies-from-congress/\">Voters boot three SOPA-sponsoring Hollywood allies from Congress</a>, though the new people might have similar views on such legislation, don&#8217;t know yet.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Nov 2012 14:49:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Weblog Tools Collection: WordPress Plugin Releases for 11/7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12206\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/Q86XkawvffY/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1021:\"<h3>New plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/advanced-page-manager/\"><strong>Advanced Page Manager</strong></a> provides a new way to create, move, edit, and publish your pages.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/hidpi-gravatars/\"><strong>HiDPI Gravatars</strong></a> enables high resolution Gravatar images on any browser that supports them.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://www.fastsecurecontactform.com/\"><strong>Fast Secure Contact Form</strong></a> lets your visitors send you a quick e-mail message and blocks all common spammer tactics. Additionally, the plugin has a multi-form feature, optional extra fields, and an option to redirect visitors to any URL after the message is sent.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/sliding-widgets/\"><strong>Sliding Widgets</strong></a> will allow you to create a dynamic sliding widget area.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/Q86XkawvffY\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Nov 2012 14:45:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"Alex King: Collaborative WordPress Development on GitHub\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://alexking.org/?p=15075\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"http://alexking.org/blog/2012/11/06/wordpress-collaboration-github\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3082:\"<p>Last night I started integrating <a href=\"http://dougal.gunters.org/plugins/documents-shortcode/\">one of</a> <a href=\"http://dougal.gunters.org/\">Dougal</a>&#8216;s plugins into a little <a href=\"https://github.com/crowdfavorite/wp-hr-log\">WordPress-based app</a> I&#8217;m building to help me keep track of HR/benefits related requests for <a href=\"http://crowdfavorite.com\">my team</a>.</p>\n<p>Since I&#8217;m building the app as a theme, I dropped the plugin into the theme. It worked great, except the path to the CSS file wasn&#8217;t correct (since the code wasn&#8217;t living in the plugins directory). A quick poke around and I found the <a href=\"https://github.com/dougalcampbell/documents-shortcode\">GitHub repo for the plugin</a>, which I quickly <a href=\"https://github.com/alexkingorg/documents-shortcode\">forked</a>, <a href=\"https://github.com/alexkingorg/documents-shortcode/commit/6bb765f753d8f44c04b5e788b127387292ee2f73\">patched (by adding a filter)</a>, and <a href=\"https://github.com/dougalcampbell/documents-shortcode/pull/1\">submitted back as a pull request</a>. This morning Dougal accepted the pull request. Done and done.</p>\n<p>At the WordPress Community Summit I participated in a session about plugin continuity and development (see <a href=\"http://make.wordpress.org/summit/2012/10/29/summary-of-afternoon-discussions/\">Abandoned Plugins</a>). It naturally included discussion about how the various developers there build their plugins. Most<sup id=\"fnref:1\"><a href=\"http://alexking.org/blog/topic/wordpress/feed#fn:1\" rel=\"footnote\">1</a></sup> of those present are hosting their primary development on GitHub and checking them in to the SVN repo on WordPress.org as a packaging step for distribution.</p>\n<p>This is why. There just isn&#8217;t a WordPress community owned property that allows for this type of developer collaboration. I think it makes sense for the plugin and theme repositories on WordPress.org to adopt a &#8220;GitHub URL&#8221; meta property for projects.<sup id=\"fnref:2\"><a href=\"http://alexking.org/blog/topic/wordpress/feed#fn:2\" rel=\"footnote\">2</a></sup> Until they do, I&#8217;m going to start adding it prominently to the README when I release new versions of my plugins.</p>\n<p>Fellow WordPress developers, please collaborate on my plugins on GitHub. Most of them are under the <a href=\"https://github.com/crowdfavorite\">Crowd Favorite account</a>, a handful are on <a href=\"https://github.com/alexkingorg\">my account</a>.</p>\n<div class=\"footnotes\">\n<hr />\n<ol>\n<li id=\"fn:1\">\nI didn&#8217;t take exact numbers, but the show of hands was pretty overwhelming if I remember correctly. I believe <a href=\"http://mitcho.com/\">Mitcho</a>&#8216;s exact comment was &#8220;I&#8217;m going to cry&#8221;.&#160;<a href=\"http://alexking.org/blog/topic/wordpress/feed#fnref:1\" rev=\"footnote\">&#8617;</a>\n</li>\n<li id=\"fn:2\">\nI should write up some of my other ideas for investing in the WP.org community soon.&#160;<a href=\"http://alexking.org/blog/topic/wordpress/feed#fnref:2\" rev=\"footnote\">&#8617;</a>\n</li>\n</ol>\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Nov 2012 18:48:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"Alex King: Twitter Tools 3.0 Screencast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://alexking.org/?p=14872\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"http://alexking.org/blog/2012/11/05/twitter-tools-3-0-screencast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:477:\"<p>To compliment the <a href=\"http://alexking.org/blog/2012/10/25/social-2-6\">screencast I did to demonstrate features of Social</a>, I put together a quick (and very rough) walk through of some of the features of Twitter Tools 3.0.</p>\n<p>I found a bug there at the end. From my testing it looks like a multi-byte string length calculation bug (the apostrophe in is curly), fixed in <a href=\"http://alexking.org/blog/2012/10/25/twitter-tools-3-0-2\">version 3.0.2</a>. Yay!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubD