n WordPress site for you – with RAMP installed and configured on both sites. You can log in, create and upload content, etc. Use the Quick Send feature to send a single change over imme [&hellip;]\'>Alex King: Take RAMP for a Spin</a></li><li><a class=\'rsswidget\' href=\'http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/cJ4VgmXEFQQ/\' title=\'WordPress 3.5 Beta 3 has been released. Since the second beta, this beta has added more than 300 changes, including a new Add Media dialog. The developers are forecasting the final WordPress 3.5 release to be in a few short weeks. This particular beta is still is not meant for live sites, but please do try it on a test installation, especially if you are a p [&hellip;]\'>Weblog Tools Collection: WordPress 3.5 Beta 3 Released</a></li></ul></div>','no'),(245,'_transient_timeout_feed_57bc725ad6568758915363af670fd8bc','1353237570','no'),(246,'_transient_feed_57bc725ad6568758915363af670fd8bc','a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n	\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:72:\"\n		\n		\n		\n		\n		\n		\n				\n\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n\n	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"WordPress Plugins » View: Newest\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"http://wordpress.org/extend/plugins/browse/new/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"WordPress Plugins » View: Newest\";s:7