INSERT INTO `wp_posts` VALUES (1,1,'2012-11-04 17:17:25','2012-11-04 17:17:25','Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!','Hello world!','','trash','open','open','','hello-world','','','2012-11-04 21:13:36','2012-11-04 21:13:36','',0,'http://toessay.co.uk.ben/?p=1',0,'post','',1),(2,1,'2012-11-04 17:17:25','2012-11-04 17:17:25','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickies to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://toessay.co.uk.ben/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','open','open','','sample-page','','','2012-11-04 17:17:25','2012-11-04 17:17:25','',0,'http://toessay.co.uk.ben/?page_id=2',0,'page','',0),(4,1,'2012-11-04 17:56:45','2012-11-04 17:56:45','An international review dedicated to the essay. Authors write from the world over.','About','','trash','open','open','','about','','','2012-11-04 17:57:48','2012-11-04 17:57:48','',0,'http://toessay.co.uk.ben/?page_id=4',0,'page','',0),(5,1,'2012-11-04 17:56:08','2012-11-04 17:56:08','','About','','inherit','open','open','','4-revision','','','2012-11-04 17:56:08','2012-11-04 17:56:08','',4,'http://toessay.co.uk.ben/?p=5',0,'revis